import React, { Component } from 'react';


export default class Navbar extends Component {
    render() {
        return (
            <div>
                <nav
                    css={css`
                        background-color: hotpink !important;
                        `}
                >
                    <a>
                        Pokemon
                    </a>
                </nav>
            </div>
        )
    }
}
